 			assert(mem_addr_i == last_mem_la_addr);
 			assert(mem_wstrb_i == 0);
 		end
 		if (last_mem_la_write) begin
 			assert(mem_valid_i);
 			assert(mem_addr_i == last_mem_la_addr);
 			assert(mem_wdata_i == last_mem_la_wdata);
 			assert(mem_wstrb_i == last_mem_la_wstrb);
