//---------------------------------------------------

module vda3384_vd6f051 #(
 parameter INI = 0
) (
 input clk,
 input sin,
 input [7:0] din,
 input load,
 input shift,
 output sout,
 output [7:0] q
);
 //-- Generic Shift Left register
 //-- With reset input
 //-- Number of bits
 localparam N = 8;
 
 //-- Initial value
 reg [N-1:0] qi = INI;
 
 always @(posedge clk)
 begin
 
   //-- Load
   if (load == 1)
     qi <= din[7:0];
     
   else
     //-- Shift to the right when the
     //-- shift iput is 1
     if (shift == 1)
 
       //-- Shift to the left
       qi <= {qi[N-2:0], sin};
 end
 
 //-- Serial out: 
 //-- It is the most significant bit
 assign sout = qi[N-1];
 
 //-- Paralell out
 assign q = qi;
endmodule
